import time

# Lightweight benchmark for NeuronWorker hot paths without requiring Neuron deps.
# We bypass __init__ to avoid importing heavy backends and hardware dependencies.

from vllm.worker.neuron_worker import NeuronWorker


class _DummySchedulerCfg:
    def __init__(self, max_num_seqs: int):
        self.max_num_seqs = max_num_seqs


class _DummyCacheCfg:
    def __init__(self):
        self.num_gpu_blocks = None
        self.num_cpu_blocks = None


def make_dummy_worker(max_num_seqs: int = 32) -> NeuronWorker:
    w = NeuronWorker.__new__(NeuronWorker)
    # Minimal attributes used by the methods we benchmark
    w.scheduler_config = _DummySchedulerCfg(max_num_seqs)
    w.cache_config = _DummyCacheCfg()
    return w


def time_fn(fn, *, repeat: int = 3, number: int = 200_000):
    best = float("inf")
    for _ in range(repeat):
        t0 = time.perf_counter()
        fn(number)
        best = min(best, time.perf_counter() - t0)
    return best


def bench_determine_num_available_blocks():
    w = make_dummy_worker(32)

    def run(n):
        for _ in range(n):
            w.determine_num_available_blocks()

    return time_fn(run)


def bench_initialize_cache():
    w = make_dummy_worker(32)
    ngb, ncb = w.determine_num_available_blocks()

    def run(n):
        for _ in range(n):
            w.initialize_cache(ngb, ncb)

    return time_fn(run)


if __name__ == "__main__":
    t1 = bench_determine_num_available_blocks()
    t2 = bench_initialize_cache()
    print({
        "determine_num_available_blocks_s": t1,
        "initialize_cache_s": t2,
    })

